import {useState} from "react";

function ObjectsChander(){
    let [pizza,setPizza] = useState({name:"Pepperoni",weight:370,price:40})
    let handleClickName = (event)=>{
        setPizza(
            prevPizza =>({...prevPizza,name:event.target.value})
        )
    }
    let handleClickWeight = (event)=>{
        setPizza((prevWeight=>({...prevWeight, weight: event.target.value})))
    }
    let handleClickPrice = (event)=>{
        setPizza(
            prevPizza =>({...prevPizza,price:event.target.valueAsNumber})
        )
    }
    return <div>
        <h1>Your food: {pizza.name}</h1>
        <h2>{pizza.name}:{pizza.price} | {pizza.name}:{pizza.weight}g</h2>
        <br/>
        <p><input type={"text"} value={pizza.name} onChange={handleClickName}/></p>
        <p><input type={"number"} value={pizza.price} onChange={handleClickWeight}/></p>
        <p><input type={"number"} value={pizza.weight} onChange={handleClickPrice}/></p>

    </div>
}

export default ObjectsChander;
